import React from "react";
import BigContext from "./BigContext"

function Box(props){

    return (
        <BigContext.Consumer>
          {(green, value) => {
            return (
              <div> {value} {green} </div>
            )
          }}
        </BigContext.Consumer>
    )
}

export default Box;
